import React, { Component } from 'react';





class Thanks extends Component {

  render() {
    return (
        <div style={{textAlign:'center', backgroundColor:'gray'}}>
        	<br/>

        	<div className='container'>
	        	<div style={{backgroundColor:'white'}}>
		        	<h2>Thanks!</h2>
		         	<h1>Your 1099 is Ready for Download</h1>
		         	<button className='btn btn-lg btn-primary'>Download 1099 PDF</button>
		         	<br/>
		         	<h6>Order Number is : 193839834834</h6>
		         	<h6>You will recieve an email confirmation shortly</h6>
		         	<br/>
		         	<h6>Questions?</h6>
		         	<h6>Call 999-999-9999 or Email...</h6>
		         	<br/>
		         	<h6>Feedback</h6>
		         	<h6>Click Here</h6>
		         	<br/>
		         	<h6>Share Us!</h6>
	         	</div>
         	</div>

         	<br/>

        </div>
    );
  }

}

export default Thanks;
